import React, {Router} from 'react'
import {Link} from "react-router-dom"
import {Consumer, withChartContext} from "./DataProvider"


const BlsLink = props=>{
    return (

           <Link className="link" onClick={props.getDataInfo} to={{
                pathname: `/study/${props.series_id}`,
                state:{props}
            }}>{props.title}</Link>

    )
}

export default withChartContext(BlsLink)
